import React, {useState, useEffect, useContext, useReducer, usePrevious} from 'react';
import {Box} from 'gestalt'
import {NavLink} from 'react-router-dom';
export default function Navbar() {
    
    return(
    <>
       <Box
        height={70}
        color="midnight"
        padding={1}
        shape="roundedBottom"
       >
            {/* {Sign in link} */}
            <NavLink to="/signin">
                <Text>Sign in</Text>
            </NavLink>
       </Box>

     
      </>
    )
}
